import React from "react";

function Botspecs({name,health,damage,armor,catchphrase,avatar_url}) {
    let botType;

  switch (bot.bot_class) {
    case "Assault":
      botType = <i className="icon large circular military" />;
      break;
    case "Defender":
      botType = <i className="icon large circular shield" />;
      break;
    case "Support":
      botType = <i className="icon large circular ambulance" />;
      break;
    default:
      botType = <div />;
  }
   return(
    <>
    <h1>{name}</h1>
    <p>{health}</p>
    <p>{damage}</p>
    <p>{armor}</p>
    <p>{catchphrase}</p>
    <img src = {avatar_url} alt = "my image">{avatar_url}</img>
    </>


   )
}
export default Botspecs
